import React from "react";
import { useLocation } from "react-router-dom";

function DoctorProfile() {
  const location = useLocation();
  const doctorData = location.state?.some;
  console.log(doctorData, "Doctor Profile");
  if (!doctorData) {
    // Handle the case where data is not available
    return (
      <div>
        <h3>No doctor data available</h3>
      </div>
    );
  }

  return (
    <div >
      <h1>Doctor Profile</h1>
      <p>Name: {doctorData.name}</p>
      <p>Specialty: {doctorData.specialty}</p>
      <p>Education: {doctorData.education}</p>
      <p>Available Hours: {doctorData.availableHours}</p>
      <p>Medical History: {doctorData.medicalHistory}</p>
    </div>
  );
}

export default DoctorProfile;
